import React,{Component} from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.bundle';


class FirstPage extends Component {
    render() { 
        return (
            <>
               <div className="headerPage">
                   <div className="header-text">
                        <h2>The world's first Triple passive income & Hyper Deflationary token listed on Centralized Exchanges (CEXes)</h2>
                        <h3>The next Break Through in Defi space by Libero Financial - an innovation enabling the 4,037.20% Fixed APY token to be Hyper Deflationary</h3>
                   </div>
                  
                <div className="row">
                    <div className="col-2"></div>
                        <div className="col-4">
                    
                                <img className="w-100 h-100  rounded-3" src="images/biggestbuyer.webp" alt="" />
                    
                        </div>
                    <div className="col-4">
                        <div   className="bg-danger w-100 h-40 mt-1">
                            <h1 className="text-white w-65 h-25"><img className="m-3" src="images/mini.png" alt="" />LIBERA Price</h1>
                        </div>
                      
                        <div className="col-2"></div>
                    </div>
                    
                </div>      

               </div>
            </>
        );
    }
}
 
export default FirstPage;
